@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:CashCard a owl:Class .
atm:ATM a owl:Class .
atm:InitialDisplay a owl:Class .

atm:hasCashCard a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:CashCard .

atm:displays a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:InitialDisplay .

[] a owl:Class ;
    owl:equivalentClass [ a owl:Restriction ;
                          owl:onProperty atm:hasCashCard ;
                          owl:someValuesFrom owl:Nothing ] ;
    rdfs:subClassOf [ a owl:Restriction ;
                      owl:onProperty atm:displays ;
                      owl:allValuesFrom atm:InitialDisplay ] .
